        public ActionResult CheckCodiceFiscaleExistOrNot(string cf)
        {
            object result = "";
            bool exist = false;
            try
            {
                if (!string.IsNullOrEmpty(cf))
                {
                    IncentiviEntities db = new IncentiviEntities();
                    cf = cf.ToUpper();
                    if (!GeneraCodiceFiscaleServizio.ControlloFormaleOK(cf))
                        throw new ImmatricolazioneException("Controllo formale NOK");
                    var idPersona = db.ANAGPERS.Where(x => x.CSF_CFSPERSONA == cf.ToUpper()).Select(x => x.ID_PERSONA).FirstOrDefault();
                    exist = idPersona == 0 ? false : true; //db.ANAGPERS.Any(x => x.CSF_CFSPERSONA == cf.ToUpper());
                    if (exist)
                        result = new { Data = idPersona/* cf*/, Exist = true, Esito = false };
                    else
                        result = new { Data = "", CodiceFiscale = cf, Exist = false, Esito = true };
                }
            }
            catch (Exception ex)
            {
                result = new { Data = "", Esito = false };
            }
            return Json(new { Data = result, JsonRequestBehavior.AllowGet });
        }

        public ActionResult ControlloDatiAnagrafici(string nome, string cognome, string dataNascita, string genere, string cf, string comune, bool nuovo = false, int idEvento = 0)
        {
            object result;
            IncentiviEntities db = new IncentiviEntities();
            if (idEvento != 0)
            {
                var row = db.XR_IMM_IMMATRICOLAZIONI.Find(idEvento);
                var rowComprel = db.COMPREL.Where(X => X.ID_PERSONA == row.ID_PERSONA).OrderByDescending(Y => Y.DTA_INIZIO).FirstOrDefault();
                if (rowComprel != null)
                {
                    var rowJomprel = db.JOMPREL.Where(x => x.ID_COMPREL == rowComprel.ID_COMPREL).FirstOrDefault();
                    if (rowJomprel != null && !rowJomprel.COD_IMMATRICOLAZIONE.Equals("L"))
                    {
                        rowJomprel.COD_IMMATRICOLAZIONE = "L";
                        db.SaveChanges();
                    }
                }

            }
            var codiceFiscale = GeneraCodiceFiscaleServizio.CalcolaCodiceFiscale(nome.ToUpper(), cognome.ToUpper(), DateTime.Parse(dataNascita), Convert.ToChar(genere), comune.ToUpper());
            try
            {
                if (string.IsNullOrEmpty(nome)
                    || string.IsNullOrEmpty(cognome)
                    || string.IsNullOrEmpty(dataNascita)
                    || string.IsNullOrEmpty(genere)
                    || string.IsNullOrEmpty(cf)
                    || string.IsNullOrEmpty(comune))
                    throw new ImmatricolazioneException("Valori obbligatori");
                if (!GeneraCodiceFiscaleServizio.ControlloFormaleOK(cf))
                    throw new ImmatricolazioneException("Controllo formale NOK");
                if (!(codiceFiscale == cf))
                {
                    var omocodice = GeneraCodiceFiscaleServizio.SostituisciLettereOmocodia(cf.ToUpper());
                    omocodice = omocodice.Substring(0, 15) + GeneraCodiceFiscaleServizio.CalcolaCarattereDiControllo(omocodice.Substring(0, 15));
                    if (codiceFiscale != omocodice)
                    {
                        throw new ImmatricolazioneException(ImmatricolazioneException.COD_FISC_ERROR);
                    }
                    else throw new ImmatricolazioneException(ImmatricolazioneException.OMOCODIA);
                }
                if (nuovo && db.ANAGPERS.Any(x => x.CSF_CFSPERSONA == cf.ToUpper()))
                    throw new ImmatricolazioneException(ImmatricolazioneException.COD_FISC_ESISTENTE);

                result = new { data = "Operazione Eseguita", Esito = true };
            }
            catch (ImmatricolazioneException ex)
            {
                result = new { data = ex.Message, Esito = false };
            }
            catch (Exception ex)
            {
                result = new { data = "Operazione non riuscita", Esito = false };
            }
            return new JsonResult { JsonRequestBehavior = JsonRequestBehavior.AllowGet, Data = result };
        }
        public ActionResult GeneraContratto(AssunzioniVM model)
        {
            object result;
            int id = 0;
            HRISFileResult res = new HRISFileResult();
            try
            {
                byte[] mioFile = null;
                if (model.SelectedFormaContratto == "9" || model.SelectedFormaContratto == "K")//TEMPO INDETERMINATO
                {
                    mioFile = AssunzioniManager.GeneraPdf_Bozza_Impiegato_TI(model);
                    //System.IO.File.WriteAllBytes(@"c:\RAI\assunzione_Impiegato_TI.docx", mioFile);
                }
                else
                {
                    if (model.SelectedMansione.StartsWith("W"))
                    {
                        if (model.SelectedMansione.Contains("660"))
                        {
                            mioFile = AssunzioniManager.GeneraPdf_Bozza_Orchestrale_TD_660(model);
                            //System.IO.File.WriteAllBytes(@"c:\RAI\assunzione_Orchestrale_TD_660.docx", mioFile);
                        }
                        else
                        {
                            mioFile = AssunzioniManager.GeneraPdf_Bozza_Orchestrale_TD(model);
                            //System.IO.File.WriteAllBytes(@"c:\RAI\assunzione_Orchestrale_TD.docx", mioFile);
                        }
                    }
                    else
                    {
                        mioFile = AssunzioniManager.GeneraPdf_Bozza_Impiegato_TD(model);
                        //System.IO.File.WriteAllBytes(@"c:\RAI\assunzione_Impiegato_TD.docx", mioFile);
                    }
                }

                string matricolaCreatore = CommonHelper.GetCurrentUserMatricola();
                List<XR_TB_FILES> files = new List<XR_TB_FILES>();


                int length = mioFile.Length;
                string tipoFile = "application/vnd.openxmlformats-officedocument.wordprocessingml.document";
                // prepara l'oggetto da salvare
                XR_TB_FILES newItem = new XR_TB_FILES()
                {
                    Attivo = true,
                    ContentByte = mioFile,
                    Length = length,
                    MimeType = tipoFile,
                    NomeFile = "Contratto_" + model.Matricola + "_" + model.Cognome + "_" + model.Nome + ".docx",
                    Tipologia = "ASSGEN",
                    MatricolaCreatore = matricolaCreatore
                };

                XR_TB_FILES file = FileAssunzioneManager.GetFilesByIdAssunzione(model.IdEvento, "ASSGEN").Files?.FirstOrDefault();
                XR_TB_FILES file2 = FileAssunzioneManager.GetFilesByIdAssunzione(model.IdEvento, "ASSGENCUSTOM").Files?.FirstOrDefault();

                if (file != null)
                {
                    FileAssunzioneManager.DeleteFile(file.Id);
                }
                if (file2 != null)
                {
                    FileAssunzioneManager.DeleteFile(file2.Id);
                }

                files.Add(newItem);

                if (files != null && files.Any())
                {
                    res = HRISFileManager.UploadFile(files, model.IdEvento);
                    if (res.Esito == true)
                    {
                        result = new { data = res.Files.FirstOrDefault().Id.ToString(), Esito = true };
                        //AssunzioneServizio assunzioneServizio = new AssunzioneServizio(new IncentiviEntities());
                        //model.DataContrattoCreazione = DateTime.Now;
                        //assunzioneServizio.SalvaJsonAssunzioni(model);
                    }

                    else
                        result = new { data = res.Errore, Esito = false };
                }
                else
                {
                    throw new Exception("L'elenco dei files da salvare è vuoto.");
                }
                if (res.Files != null && res.Files.Count > 0)
                {
                    id = res.Files.FirstOrDefault().Id;
                }
                //result = new { data = "Operazione Eseguita", Esito = true };
            }
            catch (ImmatricolazioneException ex)
            {
                result = new { data = ex.Message, Esito = false };
            }
            catch (Exception ex)
            {
                result = new { data = "Operazione non riuscita", Esito = false };
            }
            return new JsonResult { JsonRequestBehavior = JsonRequestBehavior.AllowGet, Data = result };
        }

