        [System.Web.Mvc.HttpPost]
        public ActionResult HandleAssunzioneFinal(AssunzioniVM model)
        {
            var esito = "";
            var data = "";
            int idEvento = 0;
            int idPersona = 0;
            AssunzioneServizio assunzioneServizio = new AssunzioneServizio(new IncentiviEntities());
            CreaDocumentoResponse responseDematerializzazione = null;
            try
            {
                model.Nome = model.Nome.ToUpper();
                model.Cognome = model.Cognome.ToUpper();
                if (model.IdEvento == 0)
                {
                    esito = "OK";
                    idEvento = assunzioneServizio.HandleAssunzione(model);
                    idPersona = model.IdPersona;
                    if (model.esitoCics && model.esito)
                    { esito = "OK"; }
                    else
                    {
                        esito = "KO";
                        data = "Non è stato possibile creare l'assunzione";
                    }
                }
                else
                {
                    idEvento = assunzioneServizio.HandleAssunzione(model);
                    idPersona = model.IdPersona;
                    esito = "MODIFICA";


                }
                if ((esito.Equals("OK") || esito.Equals("MODIFICA")))
                {
                    responseDematerializzazione = CreaDocumentoAssunzione(model);
                    if (!responseDematerializzazione.Esito)
                    {
                        esito = "KO";
                        data = responseDematerializzazione.Errore;
                    }
                    else
                    {
                        model.IdPraticaDematerializzazione = responseDematerializzazione.Documento.Id;
                        model.DataContrattoCreazione = DateTime.Now;
                        if (!assunzioneServizio.SalvaJsonAssunzioni(model))
                        {
                            esito = "KO";
                            data = "Si è verificato un errore imprevisto!";
                        }
                    }
                }

            }
            catch (Exception ex)
            {
                esito = "ERRORE";
                data = ex.Message;
                HrisHelper.LogOperazione("Exception", Newtonsoft.Json.JsonConvert.SerializeObject(model), false, "Errore durante il salvataggio", null, ex);
            }
            return Json(new { Data = data, Esito = esito, idPersona = idPersona, idEvento = idEvento }, JsonRequestBehavior.AllowGet);
        }
        public ActionResult EliminaAssunzione(int idEvento)
        {
            string result = "";
            try
            {
                if (idEvento != 0)
                {
                    AssunzioneServizio assunzioneServizio = new AssunzioneServizio(new IncentiviEntities());
                    var res = assunzioneServizio.EliminaAssunzione(idEvento);
                    if (!res)
                        result = "Si è verificato un errore durante la cancellazione";
                    else
                        result = "OK";
                }
                else
                {
                    throw new ImmatricolazioneException("Non è possibile cancellare l'assunzione");
                }
            }
            catch (Exception ex)
            {
                return Content(ex.Message);
                throw;
            }
            return Content(result);
        }
