            model.Principale = isPrincipal;
            myRaiCommonTasks.Helpers.HRISFileResult res = new myRaiCommonTasks.Helpers.HRISFileResult();
            List<int> ids = new List<int>();


            try
            {
                res = myRaiCommonTasks.Helpers.FileAssunzioneManager.GetFile(Convert.ToInt32(idAllegato));
                if (res.Esito && res.Files != null && res.Files.Count > 0)
                {
                    model.Allegati.AddRange(res.Files.Where(x => x.Attivo && x.Tipologia.Trim() == "ASS").ToList());
