        public ActionResult FinalizzaContratto(int idEvento)
        {
            object result;

            IncentiviEntities db = new IncentiviEntities();
            AssunzioneServizio assunzioneServizio = new AssunzioneServizio(db);
            AssunzioniVM viewmodel = new AssunzioniVM();
            bool esito = false;
            try
            {
                XR_IMM_IMMATRICOLAZIONI row = db.XR_IMM_IMMATRICOLAZIONI.Find(idEvento);

                viewmodel = Newtonsoft.Json.JsonConvert.DeserializeObject<AssunzioniVM>(row.JSON_ASSUNZIONI);
                viewmodel.Avanzamento = 100;
                if (!assunzioneServizio.FinalizzaContrattoAssunzione(viewmodel))
                {
                    esito = false;
                }
                else
                {
                    string azioneJS = String.Format("OpenModalSceltaDestinazioneTFR({0}, {1}, {2})", viewmodel.IdEvento, viewmodel.IdPersona, 0);
