                        DateTime.Now,
                        DateTime.Now.AddMonths(6),
                        null,
                        null,
                        azioneJS,
                        null,
                        azioneJS,
                        null,
                        null,
                        null);
                    if (esito)
                        Widget_Da_Fare_Manager.EliminaAzioneDaFare(viewmodel.Matricola, WidgetDaFareManagerEnum.ASSUNZIONI);

