        public static List<SelectListItem> GetListItems(string tipoValori, string sede = "")
        {
            List<SelectListItem> items = new List<SelectListItem>();

            switch (tipoValori)
            {
                case "rapplav":
                    items.AddRange(AnagraficaManager.GetTipiRapportoLavorativoAssunzione("", "", true));
                    break;
                case "tipocontratto":
                    items.AddRange(AnagraficaManager.GetTipiContratto("", "", true, false));
                    break;
                case "tipominimo":
                    items.AddRange(AnagraficaManager.GetTipoMinimoByCategoria("", "", "", sede));
                    break;
                case "tipoassunzione":
                    items.AddRange(AnagraficaManager.GetTipoAssunzione("", "", true));
                    break;
                case "formacontratto":
                    items.AddRange(AnagraficaManager.GetFormaContratto("", "", true));
                    break;
                case "causale":
                    items.AddRange(AnagraficaManager.GetCausaleAssunzione("", "", true));
                    break;
                case "modalita":
                    items.AddRange(AnagraficaManager.GetModalitaReclutamento("", "", true));
                    break;
                case "assicurazioneinfortuni":
                    items.AddRange(AnagraficaManager.GetAssicurazioneInfortuni("", "", true));
                    break;
                case "indennita":
                    items.AddRange(AnagraficaManager.GetIndennita("", "", true));
                    break;
                case "statocivile":
                    items.AddRange(AnagraficaManager.GetStatoCivile("", "", true));
                    break;
                case "insediamento":
                    items.AddRange(AnagraficaManager.GetInsediamento("", sede, true));
                    break;
                case "orario":
                    items.AddRange(AnagraficaManager.GetOrarioTipiMinimi());
                    break;
                default:
                    break;
            }

            return items;
        }

