        public ActionResult ScaricaPDF(int idAllegato)
        {
            try
            {
                var db = AnagraficaManager.GetDb();
                var item = db.XR_TB_FILES.Where(w => w.Id.Equals(idAllegato)).FirstOrDefault();
                string nomeFile = "prova.pdf";
                Stream stream = null;

                if (item != null)
                {
                    nomeFile = item.NomeFile;
                    stream = new MemoryStream(item.ContentByte);
                }
                else
                {
                    throw new Exception("Impossibile trovare il file desiderato");
                }

                return new FileStreamResult(stream, "application/pdf") { FileDownloadName = nomeFile };
            }
            catch (Exception ex)
            {
                throw ex;
            }
        }
        [System.Web.Mvc.HttpGet]
        public ActionResult GetDataPerRiepilogo(int id, int idContratto)
        {
            AssunzioniVM viewmodel = new AssunzioniVM();

            IncentiviEntities db = new IncentiviEntities();
            try
            {
                if (id != 0)
                {
                    //Edit
                    XR_IMM_IMMATRICOLAZIONI result = db.XR_IMM_IMMATRICOLAZIONI.Find(id);
                    if (!string.IsNullOrWhiteSpace(result.JSON_ASSUNZIONI))
                        viewmodel = Newtonsoft.Json.JsonConvert.DeserializeObject<AssunzioniVM>(result.JSON_ASSUNZIONI);
                    else
                    {
                        viewmodel = AssunzioniVM.ConverToImmatricolazioneVM(result);
                        viewmodel.CodiceISTAT = db.TB_COMUNE.Find(result.COD_CITTA).COD_PROV_STATE;
                        viewmodel.Cittadinanza = result.COD_CITTAD;
                        viewmodel.Nazione = result.COD_CITTAD;
                        viewmodel.SelectedServizio = result.COD_SERVIZIO;
                        viewmodel.SelectedMansione = result.COD_RUOLO;
                    }

                    if (!string.IsNullOrWhiteSpace(viewmodel.SelectedStatoCivile))
                    {
                        viewmodel.DescrizioneStatoCivile = db.TB_STATOCV.Where(x => x.COD_STCIV == viewmodel.SelectedStatoCivile).FirstOrDefault().DES_STCIV;
                    }
                    viewmodel.DescrizioneFormaContratto = db.TB_TPCNTR.Where(x => x.COD_TPCNTR == viewmodel.SelectedFormaContratto).FirstOrDefault().DES_TPCNTR;
                    viewmodel.DescrizioneTipoAssunzione = db.TB_EVENTO.Where(x => x.COD_EVQUAL == viewmodel.SelectedTipoAssunzione).FirstOrDefault().DES_EVQUAL;


                    viewmodel.DataInizioFine = viewmodel.DataInizio.ToShortDateString()
                        +
                        (viewmodel.DataFine != null && viewmodel.DataFine.HasValue && viewmodel.DataFine.Value != DateTime.MaxValue && viewmodel.SelectedFormaContratto != "9" && viewmodel.SelectedFormaContratto != "K" ?
                        ("-" + viewmodel.DataFine.Value.ToShortDateString())
                        : "");
                    if (idContratto > 0)
                        viewmodel.IdFileContratto = idContratto;
                    else
                    {
                        HRISFileResult res = FileAssunzioneManager.GetFilesByIdAssunzione(viewmodel.IdEvento, "ASSGEN");
                        HRISFileResult res2 = FileAssunzioneManager.GetFilesByIdAssunzione(viewmodel.IdEvento, "ASSGENCUSTOM");

                        if (res != null && res.Files != null && res.Files.Count > 0)
                            viewmodel.IdFileContratto = res.Files.FirstOrDefault().Id;
                        else if (res2 != null && res2.Files != null && res2.Files.Count > 0)
                            viewmodel.IdFileContratto = res2.Files.FirstOrDefault().Id;
                    }
                }
            }
            catch (Exception ex)
            {
                var message = ex;
                //Log excception 
                viewmodel = new AssunzioniVM();
            }
            return View("~/Views/Assunzione/_subpartial/TabRiepilogo.cshtml", viewmodel);
        }
        public CreaDocumentoResponse CreaDocumentoAssunzione(AssunzioniVM model)
        {
            CreaDocumentoResponse response = null;

            string matricola = CommonHelper.GetCurrentUserMatricola();
            List<XR_TB_FILES> files = FileAssunzioneManager.GetFilesByIdAssunzione(model.IdEvento).Files;
            List<int> filesPerDematerializzazione = null;
            if (files != null && files.Count > 0)
            {
                filesPerDematerializzazione = files.Select(c => c.Id).ToList();

            }

            CreaDocumentoAssunzioneRequest request = new CreaDocumentoAssunzioneRequest();
            request.MatricolaCreatore = matricola;
            request.DatiAssunzione = model;
            request.Files = filesPerDematerializzazione;
            //request.Files.AddRange(files.Where(y=>y.Tipologia == "ASS" || y.Tipologia == "ASSGEN").Select(x => x.Id));
            response = DematerializzazioneManager.CreaDocumento_Da_Assunzione(request);




            return response;
        }



    }
